import React from "react";

const MovieCard = ({ movie: {Title, PosterLink} }) => {
  return (
    <div className="movie" key={Title}>
      <div>
        <img src={PosterLink !== "N/A" ? PosterLink : "https://via.placeholder.com/400"} alt={Title} />
      </div>
      
      
    </div>
  );
}

export default MovieCard;
